import {TableFilter} from '../index';
import $ from 'jquery';

export default class TileTableHierarchyFilter extends TableFilter {

  constructor(model) {
    super();
    $.extend(this, model);
  }

  createKey() {
    return 'TileTableHierarchyFilter';
  }

  accept(row) {
    return !row.parentRow;
  }

  createLabel() {
    return this.table.session.text('ui.TileView');
  }
}
